    metabase_table.name,
    metabase_table.display_name,
    metabase_table.description,
    metabase_table.active,
    metabase_table.db_id AS database_id,
    metabase_table.schema,
    metabase_table.is_upload,
    metabase_table.entity_type,
    metabase_table.visibility_type,
    metabase_table.estimated_row_count,
    metabase_table.view_count,
    metabase_table.owner_email,
    metabase_table.owner_user_id
   FROM public.metabase_table;


