     ma_nhan_vien,\\\\n        COUNT(*) AS so_lich_hoan_thanh\\\\n    FROM fact_appointment\\\\n    WHERE trang_thai = 'Hon thnh'\\\\n    GROUP BY ma_nhan_vien\\\\n),\\\\n\\\\ndoanh_thu AS (\\\\n    SELECT \\\\n        f.ma_nhan_vien,\\\\n        SUM(s.gia_dich_vu) AS tong_doanh_thu\\\\n    FROM fact_appointment f\\\\n    JOIN dim_service s \\\\n        ON f.ma_dich_vu = s.ma_dich_vu\\\\n    WHERE f.trang_thai = 'Hon thnh'\\\\n    GROUP BY f.ma_nhan_vien\\\\n),\\\\n\\\\nso_sao AS (\\\\n    SELECT \\\\n        f.ma_nhan_vien,\\\\n        AVG(r.so_sao) AS diem_sao_trung_binh\\\\n    FROM fact_appointment f\\\\n    JOIN fact_review r \\\\n        ON f.ma_khach_hang = r.ma_khach_hang\\\\n    WHERE f.trang_thai = 'Hon thnh'\\\\n    GROUP BY f.ma_nhan_vien\\\\n)\\\\n\\\\nSELECT \\\\n    e.ten_nhan_vien,\\\\n    l.so_lich_hoan_thanh,\\\\n    ROUND(d.tong_doanh_thu / l.so_lich_hoan_thanh, 0) AS doanh_thu_tren_lich,\\\\n    ROUND(ds.diem_sao_trung_binh, 2) AS diem_sao_trung_binh\\\\nFROM lich_hoan_thanh l\\\\nJOIN dim_employee e \\\\n    ON l.ma_nhan_vien = e.ma_nhan_vien\\\\nLEFT JOIN doanh_thu d \\\\n    ON l.ma_nhan_vien = d.ma_nhan_vien\\\\nLEFT JOIN so_sao ds \\\\n    ON l.ma_nhan_vien = ds.ma_nhan_vien\\\\nORDER BY doanh_thu_tren_lich DESC;\\\\n\\"}]}","last_editor_id":1,"collection_location":"/4/","id":84,"last_edited_at":"2026-02-01T07:13:58.678069Z","dashboardcard_count":1,"collection_type":null,"display":"table","archived_directly":false,"verified":null,"dashboard_id":6,"created_at":"2026-02-01T07:13:58.626099Z","model":"card"}	2026-02-04 11:46:58.116466+00	2026-02-04 11:46:58.116466+00	f	2026-02-01 07:13:58.626099+00	\N	f	8	\N	Hiu sut nhn vin	f	2026-02-01 07:13:58.678069+00	1	[]	6	1	84	table	2026-02-04 05:23:07.752846+00	2	1	12	2026-02-01 07:13:58.626099+00	\N
